import { Fragment, useState } from 'react'
import Nav from './Nav'
import LoginForm from './users/Login'

function Home() {
    const [showLogin, setShowLogin] = useState(false)

    return (
        <Fragment>
        <Nav />

        <main className='fixed'>
            <h1>HOME</h1>
        </main>
        <LoginForm isVisible />
        </Fragment>
    )
}

export default Home
